CREATE TABLE IF NOT EXISTS `wordpress`.`wpf0_frmt_form_views`(
    `view_id` bigint unsigned NOT NULL AUTO_INCREMENT,
    `form_id` bigint unsigned NOT NULL,
    `page_id` bigint unsigned NOT NULL,
    `ip` varchar(191) NULL,
    `count` mediumint unsigned NOT NULL DEFAULT '1',
    `date_created` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
    `date_updated` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
    PRIMARY KEY  (`view_id` ),
    KEY `view_form_id` (`form_id` ),
    KEY `view_ip` (`ip` ),
    KEY `view_form_object` (`form_id` ,`view_id` ),
    KEY `view_form_object_ip` (`form_id` ,`view_id` ,`ip` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci ;
